import styled from "styled-components";

export const StyledTexture = styled.div`

  
  padding : 5px;
  margin: 5px;
  position: absolute;
  left : 50%;
  align-items : center;
 


  div > div {
    display: flex;
  }
  .grid-item {
    display: flex;
    flex-direction: column;
    justify-content: space-between;
  }
  .grid-item > div {
    display: flex;
    flex-direction: row;
    justify-content: space-between;
  }
`;
